import React from 'react'
import {Link} from 'react-router-dom'
import { useState } from 'react'
import axios from "axios";
import {ToastContainer,toast} from "react-toastify";
import 'react-toastify/dist/ReactToastify.css'


const Register = () => {



  const [inputs, setInputs] = useState({
    firstname:"",
    surname:"",
    username:"",
    email:"",
    password:"",
    confirm_password:""
  });

  const onChangeHandler = (e) => {
    const {name,value} = e.target;
    setInputs((prev) => {
      return { ...prev, [name]: value}
    })
  }


  const submitHandler = (e) => {
    e.preventDefault();

    console.log(inputs)

    axios.post("http://localhost:5000/api/user/register", {...inputs},{withCredentials:true}).then((res) => {console.log(res);

    if(!res.data.created ){
      toast('ðŸ¦„ Wow so easy!', {
        position: "top-right",
        autoClose: 5000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
        progress: undefined,
        theme: "light",
        });
      }else{
    }
   
    
 
  
  }).catch((err) => {console.log(`Request error: ${err}`)});
  }


  return (
    <div className='w-full flex justify-center items-center'>

      <form className='bg-white p-4 shadow-md border rounded my-5 py-3' onSubmit={submitHandler}>
        <h2 className='text-center w-full p-3 text-gray-500 text-xl font-bold'>Register Account</h2>

        <div className='mb-2'>
          <label className='text-gray-500 mb-2 font-bold' htmlFor="firstname">First Name</label>
          <input type='text' placeholder='firstname' id='firstname' name='firstname' onChange={onChangeHandler} className='w-full py-2 px-3 text-gray-500 shadow focus:outline-none focus:shadow-md border border-gray-500 rounded' />
        </div>

        <div className='mb-2'>
          <label className='text-gray-500 mb-2 font-bold' htmlFor="surname">Surname</label>
          <input type='text' placeholder='Surname' id='surname' name='surname' onChange={onChangeHandler} className='w-full py-2 px-3 text-gray-500 shadow focus:outline-none focus:shadow-md border border-gray-500 rounded' />
        </div>

        <div className='mb-2'>
          <label className='text-gray-500 mb-2 font-bold' htmlFor="username">Username</label>
          <input type='text' placeholder='username' id='username' name='username' onChange={onChangeHandler}  className='w-full py-2 px-3 text-gray-500 shadow focus:outline-none focus:shadow-md border border-gray-500 rounded' />
        </div>


        <div className='mb-2'>
          <label className='text-gray-500 mb-2 font-bold' htmlFor="email">Email</label>
          <input type='text' placeholder='email' id='email' name='email' onChange={onChangeHandler} className='w-full py-2 px-3 text-gray-500 shadow focus:outline-none focus:shadow-md border border-gray-500 rounded' />
        </div>


        <div className='mb-2'>
          <label className='text-gray-500 mb-2 font-bold' htmlFor="password">Password</label>
          <input type='password' placeholder='password' id='password' name='password' onChange={onChangeHandler} className='w-full py-2 px-3 text-gray-500 shadow focus:outline-none focus:shadow-md border border-gray-500 rounded' />
        </div>

        <div className='mb-2'>
          <label className='text-gray-500 mb-2 font-bold' htmlFor="confirm_password">Confirm Password</label>
          <input type='password' placeholder='confirm_password' id='confirm_password' name='confirm_name' onChange={onChangeHandler} className='w-full py-2 px-3 text-gray-500 shadow focus:outline-none focus:shadow-md border border-gray-500 rounded' />
        </div>

        <div className='flex flex-col justify-between items-center my-3 mb-5'>
          <button className='text-white font-bold bg-blue-500 py-2 px-3 border rounder hover:bg-blue-700'>Register</button>
          {/* <Link to="/login" className='text-blue-500'>Already have an account</Link> */}
        </div>

      </form>
      <ToastContainer />
    </div>
  )
}

export default Register
